import React from 'react';
import Navigation from '../components/Navigation';

const Login = () => {
  return (
    <>
      {' '}
      <Navigation
        Title="URL-shortener"
        Links={[
          {
            title: 'Login',
            ref: '/login'
          }
        ]}
      />
    </>
  );
};

export default Login;
